import CountUI from "../../components/Count"
import { connect } from "react-redux"
import { createIncrementAction } from "../../redux/count_action"
function a (state) {
    return {
        count : state
    }
}

function b (dispatch) {
    return {
        increment : (value) => {
            dispatch(createIncrementAction(value*1))
        }
        
    }
}


export default connect(a,b)(CountUI)
